<script>
  var Lirr = (function Lirr($){
      var months = [
      "January",
      "February",
      "March",
      "April",
      "May",
      "June",
      "July",
      "August",
      "September",
      "October",
      "November",
      "December"
      ];
      function init(){
      }
      function printLine(event) {
        console.log("Line: " + $(event.target.className));
      }
      function getBranchInfo(event) {
        var $target = $(event.target);
        var branchName = $target.data('display-name');
        $('.lirr-results-header-branch-name').text(branchName);
        $.get('http://haiku.jillmunson.com/lirr', showResults);
      }
      function showResults(data) {
        var delays = data['delays'];
        var firstTweet = data['first'];
        var cancellations = data['cancellations'];
        var excuses = data['excuses'];
        var branchKey = $('.lirr-results-header-branch-name').text().toLowerCase();
        if(Object.keys(delays).indexOf(branchKey) === -1){
          $('.lirr-results-body-delay-minutes').text("0");
        }
        else {
          $('.lirr-results-body-delay-minutes').text(delays[branchKey]);
        }
        if(Object.keys(cancellations).indexOf(branchKey) === -1){
          $('.lirr-results-body-cancelled-trains').text("0");
        }
        else {
          $('.lirr-results-body-cancelled-trains').text(cancellations[branchKey]);
        }
        var index = 0;
        var excusesList = $('.lirr-results-excuses-list').empty();
        var excuse = $('<li class="lirr-results-excuse"></li>');
        for(index; index < 5; index++){
          var excuseIndex = Math.floor(Math.random() * excuses.length);
          var newExcuse = excuse.clone().text(excuses[excuseIndex]);
          excusesList.append(newExcuse);
        } 
        $('.lirr-results-date-month').text(months[parseInt(firstTweet['month']) - 1]);
        $('.lirr-results-date-day').text(firstTweet['day']);
        $('.lirr-results-date-year').text(firstTweet['year']);
        $('.lirr-map').hide();
        $('.lirr-results').show();
      }
      function reset(event) {
        $('.lirr-map').show();
        $('.lirr-results').hide();
        $('.lirr-results-body-delay-minutes').text("?");
      }
      return {
        init: init,
        getBranchInfo: getBranchInfo,
        printLine: printLine,
        reset: reset,
        showResults: showResults
      }
  }(jQuery || {}));
  $(document).ready(function ready(){
    Lirr.init();
  })
  .on('click', '.lirr-line', Lirr.getBranchInfo)
  .on('click', '.lirr-results-start-over', Lirr.reset);
</script>
